INSERT INTO `v1_a908e9c1d2812c95f49f29e2960f5cc332b29fbfb93064dc937f2692c454a284` VALUES (3, 1, 1, "スタンダードコレクション", "スタンダードコレクションではポスターやペナントなど\n部屋に飾れる定番グッズが盛りだくさん！\nあなたの部屋をカルミナで彩ろう！", "1回メダル{0}枚！\n定番グッズであなたの部屋をカルミナで彩ろう！");
INSERT INTO `v1_a908e9c1d2812c95f49f29e2960f5cc332b29fbfb93064dc937f2692c454a284` VALUES (10, 2, 1, "プレミアムコレクション", "プレミアムコレクションではサイン色紙や\nブロマイドなど、★★以上のグッズが盛りだくさん！\nレアグッズをたくさんゲットしよう！", "1回メダル{0}枚！\nメンバー直筆サイン色紙など、★★以上のグッズを確定でゲット！");
INSERT INTO `v1_a908e9c1d2812c95f49f29e2960f5cc332b29fbfb93064dc937f2692c454a284` VALUES (3, 3, 1, "フェスコレクション", "フェスコレクションではカルミナサマーライブで\n大活躍するグッズが勢ぞろい！\nゲットしたグッズを片手に、いざライブ会場へ！", "1回メダル{0}枚！\nカルミナライブに参加する際のマストアイテムをゲットしよう！");
